import React from 'react';
import MenuItem from "./MenuItem";

const Menu = ({items}) => {
  return <div className='title'>
    {
      items.map((item) => {
        return <MenuItem key={item.id} {...item}/>
      })
    }
  </div>;
};

export default Menu;
